import React from 'react';
import Home from './index.js';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";


const Routing = () =>{
  return(
    <>
      <Router>
        <Switch>
          <Route path='/' component={Home}/>
          <Route path='/productos'>
            <div>
              <p> hola routing </p>
            </div>
          </Route>
        </Switch>
      </Router>
    </>
  );
}

export default Routing;
